LineComment.Text:
IF #ATIP2P.CounterMsg < "ATI_MaxMsg" THEN
    #ATIP2P.BufferFull := FALSE;
END_IF;

IF #ATIP2P.CounterMsg > 0 THEN

    #statSendTrigger := TRUE;
    #statSendData := #ATIP2P.P2PSend[1].buffer;
    #statSendLength := INT_TO_UINT(LEN(#ATIP2P.P2PSend[1].buffer));

ELSE
    #statSendTrigger := FALSE;
END_IF;

#tempREQSend := #statSendTrigger //Trigger z bufora danych do wysyłyki AND NOT #instDelaySendTG.Q //zwłoka czasowa pomiedzy kolejnymi telegramami AND NOT #statWaitingForRecvTG //brak oczekiwania na telegram zwrotny AND NOT #errorCom; //brak błędu komunikacji
// Send data #instSendP2P(REQ := #tempREQSend, "PORT" := #portNr, BUFFER := #statSendData, LENGTH := #statSendLength, DONE => #statSendDone, ERROR => #statSendError, STATUS => #statSendStatus);
// Read data #instRecvP2P("PORT" := #portNr, BUFFER := #statRecievedData, NDR => #staRecvNDR, ERROR => #statRecvError, STATUS => #statRecvStatus, LENGTH => #statRecvLength);

 REGION Kompletny telegram wysłany
    IF #statSendDone OR #statSendError THEN

        //zapamietanie ostatniego wyslanego telegramu
        #ATIP2P.LastSendMsg := #ATIP2P.P2PSend[1].buffer;

        //brak oczekiwania na telegram zwrotny
        IF NOT #ATIP2P.P2PSend[1].ReqRcvMsg THEN

            //przesuniecie kolejki FIFO i wysłanie nowego Msg
            #tempRetVal := MOVE_BLK_VARIANT(SRC := #ATIP2P.P2PSend,
                                            COUNT := INT_TO_UDINT("ATI_MaxMsg") - 1,
                                            SRC_INDEX := 1,
                                            DEST_INDEX := 0,
                                            DEST => #ATIP2P.P2PSend);

            "fcClearData"(io_VAR_Data := #ATIP2P.P2PSend[#ATIP2P.CounterMsg]);
            IF #ATIP2P.CounterMsg > 0 THEN
                #ATIP2P.CounterMsg := #ATIP2P.CounterMsg - 1;
            END_IF;
        ELSE
            #statWaitingForRecvTG := TRUE;
        END_IF;

    END_IF;
END_REGION

REGION Telegram odebrany
    #ATIP2P.P2PRecv.newMsg := #staRecvNDR;
    #ATIP2P.P2PRecv.buffer := #statRecievedData;

    IF #staRecvNDR THEN
        #statWaitingForRecvTG := FALSE;

        //przesuniecie kolejki FIFO i wysłanie nowego Msg
        #tempRetVal := MOVE_BLK_VARIANT(SRC := #ATIP2P.P2PSend,
                                        COUNT := INT_TO_UDINT("ATI_MaxMsg")-1,
                                        SRC_INDEX := 1,
                                        DEST_INDEX := 0,
                                        DEST => #ATIP2P.P2PSend);

        "fcClearData"(io_VAR_Data := #ATIP2P.P2PSend[#ATIP2P.CounterMsg]);
        IF #ATIP2P.CounterMsg > 0 THEN
            #ATIP2P.CounterMsg := #ATIP2P.CounterMsg - 1;
        END_IF;
    END_IF;
END_REGION

 REGION Obsługa błedu komunikacji
    #instDelayErrorRecvTG(IN := #statWaitingForRecvTG,
                          PT := t#5s);

    //Timeout na odpowiedz od ATI
    IF #instDelayErrorRecvTG.Q THEN
        #statWaitingForRecvTG := FALSE;
        #errorCom := TRUE;
    END_IF;

    //błędy kanalów P2P
    IF #statRecvError THEN
        #errorRecvPort := true;
    END_IF;

    IF #statSendError THEN
        #errorSendPort := true;
    END_IF;

    //reset błędów
    IF #ATI.rq.almAck.%X0 THEN
        #errorRecvPort := FALSE;
        #errorSendPort := FALSE;

        IF #errorCom THEN
            FOR #tempCount := 1 TO "ATI_MaxMsg" DO
                "fcClearData"(io_VAR_Data := #ATIP2P.P2PSend[#tempCount]);
            END_FOR;

            #ATIP2P.CounterMsg := 0;
            #errorCom := FALSE;
        END_IF;

    END_IF;

END_REGION

 // Opoznienie pomiedzy kolejnymi telegramami
#instDelaySendTG(IN := #statSendDone OR #statSendError,
                 PT := t#1000ms);
